(6, 'dsfsdfsd', 'sdfsdfsdf', '/storage/notice/1640060618.pdf', '2021-12-20 22:23:38', '2021-12-20 22:23:38', 1),
(7, 'Admission Notice', 'Description', '/storage/notice/1642000014.docx', '2022-01-12 20:06:54', '2022-01-12 20:06:54', 100),
(8, 'ড্রেস নোটিশ ২০২২', 'এতদ্বারা দারুল ইনসান মাদরাসা এর কিন্ডারগার্টেন বিভাগের সকল শিক্ষার্থী ও অভিভাবকগণকে জানানো যাচ্ছে যে, আগামী ১৯ জানুয়ারী ২০২২, এর মধ্যেই সকল শিক্ষার্থীর ড্রেস পরিহিত দুই কপি ছবি ( পেঝনে নাম লিখে) অফিসে জমা দিতে হবে। অন্যথায়', '/storage/notice/1642344768.docx', '2022-01-16 19:52:48', '2022-01-16 19:52:48', 100),
(9, 'আমন্ত্রণ পত্র', 'আগামী ১৭/০৩/২২ উস্তাদগণের জন্য একটি শিক্ষা সফরের আয়োজন করা হয়েছে। আপনি সেখানে আমন্ত্রিত।', 'image.jpg', '2022-03-14 16:04:02', '2022-03-14 16:04:02', 100),
